    2012 Monthly Report. It was recently discovered that Patricia G. Namm and Ed Rang
    had duplicate records in our database. The records each had an aggregate of less
    than $200.01 so the contributions were not itemized on the original report. Additionally,
    it was discovered that unitemized expenses totaling $4.95 to American Express
    for banking fees were not included in our original filing.    Please be assured
    that we are taking all necessary steps to ensure that these transactions and banking
    fees are properly reported in the future. If any further action is needed, please
    contact me at (608) 831-7877. Thank you in advance for your time. Sincerely, Christopher
    Louderback, Treasurer     All disbursements documented as Line 21b, Federal Operating
    Expenditures, are in support of the committee itself and did not serve as contributions
    to any other candidate, federal or non-federal.      \n"
